h1.text-2xl > a:nth-child(1) > span:nth-child(1)::after {
    content: "";
    display: inline-block;
    width: 3em;
    height: 1em;
    background: url('https://som-views.null-austin.me/svg/views/meowmeow/wait-is-that-my-weather.svg') no-repeat center center;
    background-size: contain;
    vertical-align: middle;
}

